  `f_create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
  `f_modify_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据修改时间',
